svg.script:
//
      const image2 = ["tree", "rocket", "skyscraper"];
      const image1 = ["santa", "cat", "dog"];
      const intxt1 = ["crazy", "nice", "fancy", "Critical", "Practice",  "Graphic",  "Storytelling"];
      const intxt2 = ["santa claus", "cat", "dog"];
      var input1 = document.getElementById("inputtext1");
      var input2 = document.getElementById("inputtext2");
      var img1s = document.getElementsByClassName('img1');
      var img2s = document.getElementsByClassName('img2');
      var txt1 = Math.floor(Math.random() * intxt1.length); 
      var txt2 = Math.floor(Math.random() * intxt2.length); 
      var frame = 0;
      var i1 = Math.floor(Math.random() * image1.length); 
      var i2 = Math.floor(Math.random() * image2.length); 
      var vboxs = document.getElementsByClassName('vbox');
      var decodersymbol = document.getElementById("decodersymbol");
      var elements = document.getElementsByClassName('vector');
      var encodersymbol = document.getElementById("encodersymbol");
      var promptsymbol = document.getElementById("promptrect");

    function animate() {
      frame++;
      if (frame%100 == 0){
         txt1 = Math.floor(Math.random() * intxt1.length); 
         txt2 = Math.floor(Math.random() * intxt2.length); 
         promptsymbol.setAttribute("fill","#e8ffe8")
         for(i=0;i<6;i++){
            vboxs[i].setAttribute("fill","#e8e8e8")
         }
         input1.innerHTML = intxt1[txt1];
         input2.innerHTML = intxt2[txt2];
         var i1 = Math.floor(Math.random() * image1.length); 
         var i2 = Math.floor(Math.random() * image1.length); 
         for(i=0;i<3;i++){
            img1s[i].setAttribute("visibility", "hidden");
            img2s[i].setAttribute("visibility", "hidden");
         }
         img1s[i1].setAttribute("visibility", "visible");
         img2s[i2].setAttribute("visibility", "visible");

      }
      if (frame%100 == 33){
         decodersymbol.setAttribute("fill","#e8ffe8")
         }
      if (frame%100 == 50){
          decodersymbol.setAttribute("fill","#e8e8e8")
         }
      if (frame%100 == 66){
         for(i=0;i<5;i++){
            elements[i].innerHTML= (0.5-Math.random()).toFixed(3);
            } 
         for(i=0;i<6;i++){
            vboxs[i].setAttribute("fill","#e8ffe8")
         }
      }

        requestAnimationFrame(animate);
    }
    requestAnimationFrame(animate);//
